import { useEffect } from "react";
import { useDispatch, useSelector } from "react-redux";

import { getGames } from "../../redux/actions";

function Home() {

  const dispatch = useDispatch();
  const allGames = useSelector((state)=> state.allGames);

  useEffect(()=>{
    dispatch(getGames())
  })
  return (
    <div >
      <h1>Home</h1>
    </div>
  );
}

export default Home;
